import React from 'react';
import { Routes, Route } from 'react-router-dom'; // Importa las rutas
import Login from './components/Login';  // Componente de inicio de sesión
import Chat from './components/Chat';    // Componente del chat
import RoomCreate from './components/RoomCreate'; // Crear sala de chat
import ChatList from './components/ChatList'; // Lista de salas de chat

function App() {
    return (
        <div className="App">
            <h1>Sistema de Mensajería en Tiempo Real</h1>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/chat-list" element={<ChatList />} />
                <Route path="/chat/:roomId" element={<Chat />} />
                <Route path="/create-room" element={<RoomCreate />} />
            </Routes>
        </div>
    );
}

export default App;
